                <p>{title}</p>
                <p1>{channel} <CheckCircleIcon style={{ marginTop: '2px', height: '12px', width: '12px' }} /> {views}</p1>
                <div className="card__textall__details">
                    <p>{desp}</p>
                    {/* <p>Neeraj Chopra scripted history for India as his gold medal secured the nation's first ever in Athletics. His 87.58m attempt was enough to place him at the top of the standings after 6 throws...</p> */}

                </div>
            </div>

        </div>
    )
}

export default Card
